import React from "react";
import { Nav, Dropdown } from "rsuite";

const EditorMenu = () => {
  return (
    <div style={{
        width: "20rem",
        marginLeft: "100%"
        }}>
      <Nav>
        <Dropdown title="Themes">
          <Dropdown.Item>GitHub</Dropdown.Item>
        </Dropdown>
        <Dropdown title="Editor Mode"></Dropdown>
      </Nav>
    </div>
  );
};

export default EditorMenu;
